import React from "react";
import "./styles.css";

import { Line } from "react-chartjs-2";

const data = {
  // data object stays the same
};

const legend = {
  display: true,
  position: "bottom",
  labels: {
    fontColor: "#323130",
    fontSize: 14
  }
};

const options = {
  title: {
    display: true,
    text: "Chart Title"
  },
  scales: {
    yAxes: [
      {
        ticks: {
          suggestedMin: 0,
          suggestedMax: 100
        }
      }
    ]
  }
};

export default function App() {
  return (
    <div className="App">
      <Line data={data} legend={legend} options={options} />
    </div>
  );
}
